script: |
  super -f text -I q11620.spq | sort > q11620.out

inputs:
  - name: q11620.spq
    data: |
      SELECT 52 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - col1 * + col0 + - 68 + + 13 * + + col0 BETWEEN + 86 * - col2 / - - col0 AND + - col0 * col2;
  - name: tab2

outputs:
  - name: q11620.out
    data: |
      52
      52
      52
